import React from 'react';
import '../styles.css';  

function Home() {
  return (
    <div>
      {/* Hero Section */}
      <section className="flex-1 flex items-center justify-center bg-cover bg-center"
        style={{ backgroundImage: 'url(https://umbc.edu/wp-content/uploads/2021/04/UMBCHomepageSpring21Slider1.jpg)', minHeight: '400px' }}>
        <div className="text-center text-white bg-black bg-opacity-50 p-10 rounded-xl">
          <h1 className="text-4xl md:text-5xl font-bold mb-4">Welcome to the Capstone Portfolio</h1>
          <p className="text-lg md:text-xl mb-6">Showcasing innovation and collaboration from the Capstone Program.</p>
          <a href="/view-projects" className="px-8 py-3 bg-[#111a22] text-white font-semibold rounded-lg hover:bg-gray-800 transition">Explore Projects</a>
        </div>
      </section>

      {/* Projects Section */}
      <section id="projects" className="container mx-auto py-16">
        <h2 className="text-3xl font-bold text-center mb-12 text-[#111a22]">Our Latest Projects</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {/* Project Cards */}
          <ProjectCard title="Project Title 1" description="A brief description of this amazing project and its impact on design." />
          <ProjectCard title="Project Title 2" description="An overview of the creative process and technology used in this project." />
          <ProjectCard title="Project Title 3" description="Exploring new horizons with cutting-edge techniques in web design." />
        </div>
      </section>
    </div>
  );
}

function ProjectCard({ title, description }) {
  return (
    <div className="bg-white shadow-lg rounded-xl p-6">
      <img src="https://via.placeholder.com/300x200" alt={title} className="rounded-lg mb-4" />
      <h3 className="text-xl font-semibold mb-2">{title}</h3>
      <p className="text-gray-600">{description}</p>
    </div>
  );
}

export default Home;
